// ButtonContainer.js
import React from 'react';


function ButtonContainer() {
    const buttons = Array.from({ length: 8 }, (_, index) => (
        <button key={index} className="button">
            Button {index + 1}
        </button>
    ));

    const topButtons = buttons.slice(0, 4);
    const bottomButtons = buttons.slice(4);

    return (
        <div className="button-container">
            <div className="top-buttons">{topButtons}</div>
            <div className="bottom-buttons">{bottomButtons}</div>
        </div>
    );
}

export default ButtonContainer;
